    false,nt"url": null,nt"notes": "This Light Detection and Ranging (LiDAR)
    classified (ASPRS LAS classifications) dataset is a topographic survey conducted
    for the West Texas Aerial Survey 2009 project. This data was produced for the US
    Army Corps of Engineers (USACE) Joint Airborne Lidar Bathymetry Technical Center
    of Expertise (JALBTCX). The LiDAR point cloud was flown at a density sufficient
    to support a maximum final post spacing of 1 point per meter. 3001 International
    Inc. acquired 81 flightlines between February 3, 2009 and April 23, 2009. The West
    Texas Aerial Survey 2009 was collected under the guidance of a Professional Mapper/Surveyor.
    The area of coverage includes portions of the coastline in the following counties:
    Aransas, Brazoria, Calhoun, Cameron, Kenedy, Kleberg, Matagorda, Nueces, San Patricio,
    and Willacy.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
